import Typewriter from 'typewriter-effect';

export default function Landing() {
    return (
        <div className="auth-parent">
            <div className="panel">
                <div className="paneltext">
                <Typewriter 
                    onInit={(typewriter) => {
                        typewriter.typeString("William Toth OS").start()
                    }}
                    options={{
                        autoStart: true,
                    }}
                />
                <Typewriter 
                    onInit={(typewriter) => {
                        typewriter.typeString("Copyright (c) 2022. All Rights Reserved").start()
                    }}
                    options={{
                        autoStart: true,
                    }}
                />
                <Typewriter 
                    onInit={(typewriter) => {
                        typewriter.typeString("Release 1.0").start()
                    }}
                    options={{
                        autoStart: true,
                    }}
                />
                </div>
            </div>
        </div>
    )
}
